int uECC_valid_point(const uECC_word_t *_public, uECC_Curve curve) {
    uECC_word_t tmp1[4];
    uECC_word_t tmp2[4];
    wordcount_t num_words = curve->num_words;

    /* The point at infinity is invalid. */
    if (uECC_vli_isZero((_public), (curve)->num_words * 2)) {
        return 0;
    }

    /* x and y must be smaller than p. */
    if (uECC_vli_cmp_unsafe(curve->p, _public, num_words) != 1 ||
            uECC_vli_cmp_unsafe(curve->p, _public + num_words, num_words) != 1) {
        return 0;
    }

    uECC_vli_modSquare_fast(tmp1, _public + num_words, curve);
    curve->x_side(tmp2, _public, curve); /* tmp2 = x^3 + ax + b */

    /* Make sure that y^2 == x^3 + ax + b */
    return (int)(uECC_vli_equal(tmp1, tmp2, num_words));
}

